  const [roomName, setRoomName] = useState("");  // Room Ã  crÃ©er ou rejoindre
  const [isInRoom, setIsInRoom] = useState(false);  // VÃ©rifier si l'utilisateur est dans une room
  const [userName, setUserName] = useState("");  // Pseudo de l'utilisateur
  const [isNameSet, setIsNameSet] = useState(false);  // VÃ©rifier si l'utilisateur a dÃ©fini un pseudo

  useEffect(() => {
