    return () => {
      socket.off("message");
    };
  }, []);

  // Fonction pour envoyer un message et gÃ©rer les commandes
  const sendMessage = () => {
    if (message.trim() !== "") {
      if (message.startsWith("/createRoom")) {
        const room = message.split(" ")[1];  // Extraire le nom de la room aprÃ¨s "/createRoom"
        if (room) {
          socket.emit("createRoom", room);  // CrÃ©er la room
          setRoomName(room);  // DÃ©finir le nom de la room actuelle
          setIsInRoom(true);  // L'utilisateur est dans la room
