          setMessage("");  // RÃ©initialiser l'input
        } else {
          setChat((prevChat) => [...prevChat, "Erreur: veuillez spÃ©cifier un nom de room."]);
        }
      } else if (message.startsWith("/joinRoom")) {
        const room = message.split(" ")[1];  // Extraire le nom de la room aprÃ¨s "/joinRoom"
        if (room) {
          socket.emit("joinRoom", room);  // Rejoindre la room
          setRoomName(room);  // DÃ©finir le nom de la room actuelle
          setIsInRoom(true);  // L'utilisateur est dans la room
          setChat([]);  // RÃ©initialiser le chat
          setMessage("");  // RÃ©initialiser l'input
        } else {
          setChat((prevChat) => [...prevChat, "Erreur: veuillez spÃ©cifier une room Ã  rejoindre."]);
        }
      } else {
        // Si ce n'est pas une commande, envoyer le message normal avec le pseudo
        if (roomName.trim() !== "") {
          socket.emit("sendMessage", { room: roomName, message, userName });  // Envoyer le message avec le pseudo
          setMessage("");  // RÃ©initialiser l'input aprÃ¨s l'envoi
        }
      }
    }
  };

  // Fonction pour dÃ©finir le pseudo de l'utilisateur
  const setUserNameHandler = () => {
    if (userName.trim() !== "") {
      setIsNameSet(true);  // Le pseudo est dÃ©fini
    } else {
      alert("Veuillez entrer un pseudo.");
    }
  };

  return (
    <div style={{ padding: "20px" }}>
      <h1>ðŸ’¬ Chat WebSocket</h1>

      {/* Ã‰tape pour dÃ©finir le pseudo */}
      {!isNameSet && (
        <div>
          <input
            type="text"
            value={userName}
            onChange={(e) => setUserName(e.target.value)}
            placeholder="Choisissez un pseudo"
            style={{ width: "80%", marginRight: "10px" }}
          />
          <button onClick={setUserNameHandler}>DÃ©finir le pseudo</button>
        </div>
      )}

      {/* Champ pour entrer le nom de la room */}
      {isNameSet && !isInRoom && (
        <div>
          <input
            type="text"
            value={message}
            onChange={(e) => setMessage(e.target.value)}
            placeholder="Tapez /createRoom <nom de la room> ou /joinRoom <nom de la room>"
            style={{ width: "80%", marginRight: "10px" }}
          />
          <button onClick={sendMessage}>Envoyer</button>
        </div>
      )}

